'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term7' => 'இந்த விதிமுறைகள் U.S.A வின் கலிஃபோர்னியா மாகாண சட்டங்களால் நிர்வகிக்கப்படுகின்றன, கலிஃபோர்னியா மாகாண சட்டங்களின் கூற்றுகள் முரண்படும்போது மட்டும் இதற்கு விலக்குண்டு. இந்த சட்டங்களின் விதிமுறைகளின் ஏதேனும் பகுதி செல்லாததானாலோ அல்லது நடைமுறைப்படுத்த முடியாததாக ஆனாலோ, மீதமுள்ள பகுதிகள் முழுமையாக நடைமுறைப்படுத்தக்கூடியதாகவும் செல்லுபடியானதாகவும் இருக்கும். இந்த விதிமுறைகளின் மொழிபெயர்க்கப்பட்ட பதிப்புக்கும் ஆங்கில மொழிப் பதிப்புக்கும் முரண்பாடு இருக்கும்பட்சத்தில், ஆங்கில மொழிப் பதிப்பே கட்டுப்படுத்துவதாக கருதப்படும்.',
'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term4' => 'சேவைகள் &#34;உள்ளபடியே&#34; வழங்கப்படுகின்றன.  &amp;vendorShortName;, அதன் பங்களிப்பாளர்கள், உரிமதாரர்கள் மற்றும் விநியோகஸ்தர்கள் அனைவரும், இந்த சேவைகள் வர்த்தகத்திற்கு ஏற்றது மற்றும் உங்கள் குறிப்பிட்ட தேவைக்குப் பொருந்தும் என்பது போன்ற காப்புறுதிகள் உட்பட (ஆனால் அவை மட்டுமல்ல) வெளிப்படையான அல்லது குறிப்பாக உணர்த்தப்படுகின்ற எல்லா காப்புறுதிகளையும் பொறுப்புதுறக்கின்றனர்.  சேவைகளைப் பயன்படுத்தத் தேர்வு செய்வதிலும் சேவைகளின் செயல்திறன் மற்றும் தரத்திற்கான அனைத்து நிகழ்வுகளுக்கும் நீங்களே பொறுப்பு. சில சட்ட அதிகார எல்லை மண்டலங்கள் குறிப்பால் உணர்த்தப்படுகின்ற காப்புறுதிகளை விலக்குவதை அல்லது கட்டுப்படுத்துவதை அனுமதிக்காது, ஆகவே இந்த பொறுப்புதுறப்பு உங்களுக்குப் பொருந்தாமல் போகலாம்.',
'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term5' => 'சட்ட ரீதியான அவசியம் ஏற்பட்டாலொழிய, நீங்கள் &amp;brandShortName; மற்றும் சேவைகளைப் பயன்படுத்துவதால் ஏற்படும் அல்லது அது தொடர்பாக சந்திக்கும் மறைமுகமான, பிரத்யேகமான, தற்செயலான, விளைவாக ஏற்படுகின்ற, தண்டனை வகையிலான அல்லது எச்சரிக்கும் வகையிலான எந்த சேதங்களுக்கும் &amp;vendorShortName;, அதன் பங்களிப்பாளர்கள், உரிமதாரர்கள் மற்றும் விநியோகஸ்தர்கள் எவரும் பொறுப்பாகமாட்டார்கள்.  இந்த விதிமுறைகளின் கீழ் மொத்த கடன் பொறுப்பு $500 க்கு (ஐந்நூறு டாலர்கள்) மிகாது. சில சட்ட அதிகார மண்டலங்கள் குறிப்பிட்ட சேதங்களுக்கான விலக்கம் அல்லது கட்டுப்பாட்டை அனுமதிக்காது, ஆகவே இந்த விலக்கமும் கட்டுப்பாடும் உங்களுக்குப் பொருந்தாமல் போகலாம்.',
