'toolkit/chrome/global/aboutRights.dtd:rights2.webservices-term1' => '&amp;vendorShortName; மற்றும் அதன் பங்களிப்பாளர்கள், உரிமதாரர்கள் மற்றும் கூட்டாளர்கள் ஆகிய அனைவரும் மிக துல்லியமான மற்றும் புதுப்பிக்கப்பட்ட சேவைகளையே வழங்க செயல்படுகின்றனர்.  இருப்பினும், இந்தத் தகவல்முழுமையானது என்றும் பிழையற்றது என்றும் எங்களால் உறுதியளிக்க முடியாது.  எடுத்துக்காட்டுக்கு, பாதுகாப்பான உலாவல் சேவையானது சில ஆபத்தான தளங்களை அடையாளம் காணாமல் போகலாம் அதே போல் சில பாதுகாப்பான தளங்களைத் தவறுதலாக அடையாளம் காணலாம் இருப்பிடமறிந்த சேவையில் எங்கள் சேவை வழங்குநர்கள் வழங்கும் அனைத்து இருப்பிடங்களுமே மதிப்பீடுகள் மட்டுமே, மேலும் வழங்கப்படும் இருப்பிடங்கள் துல்லியமானது என நாங்களோ எங்கள் சேவை வழங்குநர்களோ உத்தரவாதமளிப்பதில்லை.',
